import * as React from 'react';
import PropTypes from 'prop-types';
import './card.scss';

const componentClassName = 'card'

const Card = ({
  id,
  style,
  children,
}) => {
  return (
    <p>
      I'm Melissa, a Computer Science major at Stanford University. I am a software engineer
      intern at Pareto Inc., working with React JS and GraphQL to build and maintain responsive
      web pages.
      <br />
      In my free time, I enjoy playing ultimate frisbee and learning more about the programming
      world through independent coding projects. Feel free to check out my Github!
    </p>
  )
}

Card.propTypes = {
  /**
   * The HTML id for this element
   */
  id:PropTypes.string,

  /**
   * The React-written, css properties for this element.
   */
  style:PropTypes.objectOf(PropTypes.string),

  /**
   * The children JSX
   */
  children:PropTypes.node,
}

Card.defaultProps = {
};

export default Card
